package views;

import org.json.JSONObject;

import playCanvasViews.DynamicWebPage;
import playCanvasViews.textureStream;

import java.util.ArrayList;
import java.util.HashMap;

import org.json.JSONArray;
import storage.DatabaseInterface;
import storage.FileStoreInterface;
import web.WebRequest;
import web.WebResponse;

public class ThreeJS extends DynamicWebPage {
	
	private JSONObject pageState = new JSONObject(); //everything relating to the current page state, e.g. for the avatar last line spoken 
	
	private String transparent1 = "data:image/png;base64,";
	private String minecraftCube = "data:image/png;base64,";
	
	private ArrayList<String> textures = new ArrayList<String>();
	
	private double[] meshUvsArr = new double[] {1, 1,
    		0, 1,
    		0, 0,
    		1, 0};    
    private double[] meshPointsArr = new double[] {1, 1, 0, 
    		-1, 1, 0, 
    		-1, -1, 0, 
    		1, -1, 0 };
    private int[] meshIndicesArr = new int[] { 0, 1, 2, 0, 2, 3 }; 
	
    public ThreeJS(DatabaseInterface db, FileStoreInterface fs) {
		super(db, fs);
		// TODO Auto-generated constructor stub

		pageState.put("textureIndex", 0);
		textures.add(transparent1);
		textures.add(minecraftCube);
    } 
    
    public boolean process(WebRequest toProcess)
    {
        if(toProcess.path.equalsIgnoreCase("threejs"))
        {
            String stringToSendToWebBrowser = "<html>\n" + 
        			"<head>"+
        				"<script src=\"./js/three.js\"></script>\n" + 
            			"<script src=\"./js/JavaEntity.js\"></script>\n" + 
            			"<script src=\"./js/FirstPersonCam.js\"></script>\n" + 
                        "<link href=\"css/stats.css\" rel=\"stylesheet\" type=\"text/css\">" +
            		"</head>"+
            		"<body>\n"+ 
            		"<script src=\"js/main.js\"></script>\n"+
            		"  </body>\n" + 
            		"</html>";

            toProcess.r = new WebResponse( WebResponse.HTTP_OK, WebResponse.MIME_HTML, stringToSendToWebBrowser );
            return true;
        }
        
        else if(toProcess.path.equalsIgnoreCase("threejs/Start"))
        { 	  	
        	JSONObject responseData = new JSONObject();
            JSONArray entities = new JSONArray();

            JSONObject entity1 = makeEntity(meshPointsArr, meshUvsArr, meshIndicesArr, "assest", "texture", 0, 0, 0, false, 
            		textures.get( (int) pageState.get("textureIndex")));
            
            entities.put(0, entity1);       
            
            responseData.put("entities", entities);
            
            responseData.put("vr", true); 
                    
            responseData.put("time", System.currentTimeMillis()); 
                        
            toProcess.r = new WebResponse( WebResponse.HTTP_OK, WebResponse.MIME_PLAINTEXT, responseData.toString() );
            return true;
        }
        
        else if(toProcess.path.equalsIgnoreCase("threejs/Update"))
        {  	
            JSONObject responseData = new JSONObject();
            JSONArray entities = new JSONArray();     
            
            int index = Integer.parseInt(pageState.get("textureIndex").toString());
            
            JSONObject entity1 = makeEntity(meshPointsArr, meshUvsArr, meshIndicesArr, "assest", "texture", 0, 0, 0, false, 
            		textures.get(index));
            
            entities.put(0, entity1);       
            
            responseData.put("entities", entities);
            
            responseData.put("vr", true); 
                    
            responseData.put("time", System.currentTimeMillis());             
            toProcess.r = new WebResponse( WebResponse.HTTP_OK, WebResponse.MIME_PLAINTEXT, responseData.toString() );
            return true;
        }
        
        else if(toProcess.path.equalsIgnoreCase("threejs/UpdateState"))
        {  	
            //update the state of the server
        	for(String key : toProcess.params.keySet()) {
        		pageState.put(key.toString(), toProcess.params.get(key));
        	}
        	
            toProcess.r = new WebResponse( WebResponse.HTTP_OK, WebResponse.MIME_PLAINTEXT, pageState.toString() );
            return true;
        }
        
        else if(toProcess.path.equalsIgnoreCase("threejs/GetState"))
        {  	
            //return the state of the program for the other servers to use
            toProcess.r = new WebResponse( WebResponse.HTTP_OK, WebResponse.MIME_PLAINTEXT, pageState.toString() );
            return true;
        }
         
        return false;
    }
  
    public JSONObject makeEntity(double[] positionsArr, double[] uvsArr, int[] indiciesArr, String  model, String name, double x, double y, double z, boolean realTimeModel, String texture)
    {
    	 JSONObject entity = new JSONObject();
         JSONObject vertexData = new JSONObject(); 
         
         JSONArray positions = new JSONArray(positionsArr);     
         JSONArray uvs = new JSONArray(uvsArr);
         JSONArray indicies = new JSONArray(indiciesArr);
         
         vertexData.put("position", positions);
         vertexData.put("uvs", uvs);
         vertexData.put("indices", indicies);
         
         
         //entity.put("model", model);
         entity.put("name", name);
         entity.put("x", x);
         entity.put("y", y);
         entity.put("z", z);
         entity.put("xRotate", 0);
         entity.put("boundingBoxX", 0.5);
         entity.put("boundingBoxY", 0.5);
         entity.put("boundingBoxZ", 0.5);
         entity.put("realtimeModel", realTimeModel);
         entity.put("vertexData", vertexData);
         entity.put("texture", texture);
         
         return entity;
    }
}